css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("piclist.com"), domain("piclist.org"), domain("massmind.org") {

body, table, td, th { font:14px/1.1 sans-serif !important; }
body { 
  text-align:left !important; 
  margin:1.2em .5em !important; 
  padding:0 !important; 
  color:#EEF !important;
}
body, 
textarea,
div#upperright,
div#upperleft,

table tr,
td[bgcolor] {
  background:#35577D url(data:image/jpeg;base64,) 0 0 no-repeat !important;
}

img { border:0 !important; }
table {
  border-collapse:collapse;
  border:1px solid #40638B !important;
}
a, 
a:link,
a:active  { color:#BCE !important; text-decoration:none !important; }
a:visited { color:#9AC !important; text-decoration:none !important; }
a:hover   { color:#FFF !important; text-decoration:underline !important; }
input, select  {
  border-width:1px;
  border-color:#416A99; 
  padding:0 .2em; color:#CCD; 
  background:#40638B; 
}

textarea {
  border-width:1px;
  border-color:#416A99; 
  padding:0 .2em; color:#EEF; 
  width:98%;
}

font {
  color:inherit !important;
  font:inherit !important;
}
span[style*="background"] font[color] {
  color:#000 !important;
}
span#spell_container,
a[onclick] { 
  color:#003 !important; 
  background:#EEF !important; 
}

/**************************************************\
* ebay + misc ads 
*/
script[src*="ebay"]+table,
table[width="201"][align="right"] {
  width:100px !important;
  opacity:.5 !important;
}
script[src*="ebay"]+table * {
  background:none !important;
}
script[src*="ebay"]+table td,
table[width="201"][align="right"] td {
  font-size:.7em !important;
}
table[width="30%"][bgcolor][align="left"] {
  opacity:.5 !important;
}
table[width="201"][align="right"] iframe {
  width:100% !important;
}
iframe[name="google_ads_frame"] {
  opacity:.2 !important;
}

/* alternatively: */
/*
script[src*="ebay"]+table,
iframe[name="google_ads_frame"],
table[width="201"][align="right"] {
  display:none !important;
}
*/

/**************************************************\
* corner items
*/
div#upperleft,
div#upperright { 
  color: #EEF !important;
  border-width:0 !important; 
  padding-bottom:2px !important;
}

div#upperright #search { 
  border-width:1px !important;
  border-color:#416A99 !important;
  background:#EEF !important;
  color:#003 !important; 
  padding:0 2px !important;
  width:90% !important;
}
div#upperright       { width:10em !important; }
div#upperright:hover { width:14em !important; }

div#upperright:hover,
div#upperleft:hover { 
  font-size:1.3em; 
  padding:0 1em;
  border:1px solid #EEF !important; 
}  

/**************************************************\
* logo replacement
*/
img[src$="piclistcomlogo.gif"] {
  background-image:url(data:image/png;base64,) !important;
  background-repeat: no-repeat !important;
  height:0 !important;
  overflow:hidden !important;
  padding-top:79px !important;
  width:264px !important;
}
}
